__NUXT_JSONP__("/drugs/Astuprotimut-R", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"949885-73-8",chebiId:b,chemicalFormula:b,definition:"A cancer vaccine consisting of a recombinant form of human melanoma antigen A3 (MAGE-A3) combined with a proprietary adjuvant with potential immunostimulatory and antineoplastic activities. Upon administration, astuprotimut-R may stimulate a cytotoxic T lymphocyte (CTL) response against tumor cells expressing the MAGE-A3 antigen, resulting in tumor cell death. MAGE-A3, a tumor-associated antigen (TAA) originally discovered in melanoma cells, is expressed by various tumor types. The proprietary immunostimulating adjuvant in this agent is composed of a specific combination of immunostimulating compounds selected to increase the anti-tumor immune response to MAGE-A3.",fdaUniiCode:"50I23C5UOR",identifier:"C78478",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C1663"],synonyms:["ASTUPROTIMUT-R",a,"GSK1203486A","MAGE-A3","Recombinant MAGE-A3 ASCI GSK1203486A"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAstuprotimut-R",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Astuprotimut-R","","2021-10-30T13:45:13.133Z")));